/*ARREGLAR PROBLEMA DE LOS SUBFOROS EDNTRO DE UN SUBFORO QUE NO SE VEN*/
#content-container div#container {
    float: none;
}
#wrapper {
    overflow: hidden;
}

/*QUITAR LA PUBLICIDAD*/
div#main-content > div[style=\\\\\\\\\\\\\\\"overflow:visible\\\\\\\\\\\\\\\"] {
 	display:none; 
}


/*TUTO DESDE CERO, NECROMANCER*/
#wrap {/*Este es para ajustar el ancho del foro. También le pone borde, fondo transparente y padding a la cuestión*/
width: 1350px;
min-width:1350px;
max-width:1350px;
background:var(--bgwrap);
border: 1px solid var(--borderwrap);
padding:30px;
border-radius:10px;
}

.wrapfalsuki { /*CON ESTA MIERDA ARREGLÉ TEMPORALMENTE EL COSO DEL WRAP EN EL FOOTER :(*/
    margin-top: -80px;
}

body#phpbb {/*Esto nos ajustará el fondo del foro y lo centrará.*/
 background-size:cover;
 background-position:center;
}  

*::selection{/*Esto hará que cuando selecciones algo en el foro, el fondo corresponda con el acento que hemos declarado en las variables. 
    Si tu acento es muy claro, te conviene cambiar el color de texto a uno más oscuro que blanco.*/
 background:var(--accent1);
 color:white;
}  

::-webkit-scrollbar {/*Este es un código básico de scrollbar para navegadores webkit. */
 width: 5px;
 height: 5px;
}
::-webkit-scrollbar-button {
 width: 0px;
 height: 0px;
}
::-webkit-scrollbar-thumb {
 background: var(--colorcin);
 border:2px solid #090909;
}
::-webkit-scrollbar-track {
 background:#090909;
}
::-webkit-scrollbar-corner {
 background: transparent;
}

#criteo_sticky {/*Este es pa ocultar un anuncio random de FA*/
display:none;
}  

body#phpbb {/*Le hemos añadido también un par de cosas al body y al #wrap para posicionar el cuerpo de forma centrada respecto a las navegaciones.*/
   margin-top: 0!important;
   padding: 111px 0 0 61px!important;
}

#main .linklist {
  display: none;
}

#wrap .linklist {
  display: none;
}

div#wrap {
   margin-top: 100px;
}

/*TEXTO EN EL INTERIOR DE LA RESPUESTA EN POSTS*/

#message-box textarea {
	color:#080808!important;
}

/*TOOLBAR*/

/*BARRA DE NAVEGACIÓN SUPERIOR*/
#topnav, .tnenv {
    display: flex;
    justify-content: center;
    align-items: center;
}

#topnav {
    position: absolute;
    top: 0;
    left: 61px;
    right: 0;
    height: 180px;
    border-bottom: 1px solid var(--colorcin);
    background: var(--tbckg);
}


.frasecosastntop {
    color: var(--colorcin);
    position: absolute;
    top: 0;
    right: 200px;
}

.frasecosastntop b {
    color: #ededed;
    margin-left: 10px;
}

.tntopwelcome {
    box-sizing: border-box;
}

.tntop {
    height: 59px;
    font: 14px \\\\\\\\\\\\\\\'Montserrat\\\\\\\\\\\\\\\';
    text-transform: uppercase;
    line-height: 60px;
    padding-left: 20px;	
    font-family: \\\\\\\\\\\\\\\'Roboto Slab\\\\\\\\\\\\\\\', serif;
}

.tntop strong {
	font-weight:bolder;
  	color:var(--colorcin);
}

.tnenv {
    flex-direction: column;
    flex-grow: 1;
    align-self: stretch;
    background-image: url(https://images2.imgbox.com/be/08/hW9PoDYk_o.png);
    justify-content: space-between;
}

.tnenv>* {
    align-self: stretch;
}

.tnbot {
    height: 50px;
    padding-left: 20px;
    font-size: 0;
}

.tnbot a:last-of-type {
    font-weight: 700;
    color: var(--colorcin);
}
.tnbot a {
    font-size: 8px;
    letter-spacing: 4px;
    color: #ededed;
    line-height: 50px;
    text-transform: uppercase;
    background-color: var(--bgwrap);
    box-sizing: border-box;
    padding: 5px;
    margin-right: 10px;
}

/*a:visited {
    color: #755959;
    text-decoration: none;
}*/

.tnicon {
    padding: 35px;
    border-left: 1px solid var(--colorcin);
    flex-shrink: 0;
    height: 110px;
    width: 110px;
    overflow: hidden;
    
}

.tnicon img {
    width: 130px;
    height: 135px;
    margin-left: -11px;
    object-fit: cover;
    outline: 1px solid var(--colorcin);
    outline-offset: 5px;
    margin-top: -15px;
    border-radius: 5px;
}


/*BARRA DE NAVEGACIÓN LATERAL*/
#nav {
    position: fixed;
    left: 0;
    top: 0;
    bottom: 0;
    background: var(--tbckg);
    border-right: 1px solid var(--colorcin);
    display: flex;
    justify-content: flex-start;
    align-items: center;
    flex-direction: column;
    font-size: 0;
    padding: 9px;
    background-image: url(\\\\\\\\\\\\\\\"https://images2.imgbox.com/8e/10/Z3YD9EHF_o.png\\\\\\\\\\\\\\\");
}

#nav a.mainmenu:hover {
	color:var(--colorcin);
}

#nav a.mainmenu {
    background: var(--tbckg);
    border: 1px solid var(--colorcin);
    width: 40px;
    height: 40px;
    border-radius: 10px;
    display: block;
    margin-bottom: 9px;
    text-align: center;
    line-height: 40px;
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f015\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/images\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f03e\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}


#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/faq\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f02d\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/search\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f002\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/memberlist\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f500\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/groups\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\e595\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/profile?mode=editprofile\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f007\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href=\\\\\\\\\\\\\\\"/privmsg?folder=inbox\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f0e0\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href*=\\\\\\\\\\\\\\\"/login\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f011\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu[href*=\\\\\\\\\\\\\\\"/register\\\\\\\\\\\\\\\"]:before 
{
  content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f044\\\\\\\\\\\\\\\";
  font-family: \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
  font-size:15px;
  
}

#nav a.mainmenu:before {
    content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f011\\\\\\\\\\\\\\\";
    font-family: \\\\\\\\\\\\\\\'Font Awesome 5 Free\\\\\\\\\\\\\\\';
    font-size: 14px;
    font-weight: 700;
    color: #888;
}

#nav a:hover {
    color: #ad1a1a;
}


/*TOOLBAR FIJA*/
#fa_toolbar {
    right: unset!important;
    top: 730px;
    left: 0!important;
    bottom: 0!important;
    width: 34px;
    min-width: 42px;
    height: 93px;
    background: none!important;
    margin-left: -3px;
}

a#fa_notifications { 
  font-size: 0px; 
}

#fa_hide {
	display:none;
        visibility:hidden;
  	opacity:0;
}

a#fa_welcome{
	font-size:0;
}

#fa_menu:hover :visited, #fa_toolbar > #fa_right.notification > #fa_notifications {
  color: #333;
 background-color:transparent!important;	
}

#fa_right.welcome #fa_menu #fa_welcome {
  color: #333;
  background-color:transparent!important;
}

a#fa_welcome:before {
    content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f007\\\\\\\\\\\\\\\";
    font: 16px \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
    background: var(--tbckg);
    border: 1px solid var(--colorcin);
    width: 40px;
    height: 40px;
    border-radius: 10px;
    display: block;
    margin-bottom: 9px;
    text-align: center;
    line-height: 40px;
    color: var(--colorcin);
      margin-left: 5px;
    position: absolute;
}

a#fa_notifications:before {
    content: \\\\\\\\\\\\\\\"\\\\\\\\\\\\\\\\f0f3\\\\\\\\\\\\\\\";
    font: 16px \\\\\\\\\\\\\\\"Font Awesome 5 Free\\\\\\\\\\\\\\\";
    background: var(--tbckg);
    border: 1px solid var(--colorcin);
    width: 40px;
    height: 40px;
    border-radius: 10px;
    display: block;
    margin-left: -15px;
    text-align: center;
    line-height: 40px;
    color: var(--colorcin);
    position: absolute;
    bottom: 37px;
}
 
#fa_menulist {
    bottom: 30px;
    right: 51px;
    left: 100px!important;
}
  #fa_right {
 	position:fixed; 
 }
ul.notif_list  {
    	position:fixed;
}

/*SELECTOR RGB*/


.colorpicker {
   width: 356px;
   height: 176px;
   overflow: hidden;
   position: absolute;
   background: url(https://i.servimg.com/u/f83/17/45/19/77/light11.png) !important;
   font-family: Arial, Helvetica, sans-serif;
   display: none;
   padding: 0 !important;    
}
.colorpicker.dark{
 background: url(https://i.servimg.com/u/f83/17/45/19/77/dark11.png) !important;
}
.colorpicker_color {
   width: 150px;
   height: 150px;
   left: 14px;
   top: 13px;
   position: absolute;
   background: #f00;
   overflow: hidden;
   cursor: crosshair;
}
.colorpicker_color div {
   position: absolute;
   top: 0;
   left: 0;
   width: 150px;
   height: 150px;
   background: url(https://i.servimg.com/u/f83/17/45/19/77/colorp10.png);
}
.colorpicker_color div div {
   position: absolute;
   top: 0;
   left: 0;
   width: 11px;
   height: 11px;
   overflow: hidden;
   background: url(https://i.servimg.com/u/f83/17/45/19/77/colorp10.gif);
   margin: -5px 0 0 -5px;
}
.colorpicker_hue {
   position: absolute;
   top: 13px;
   left: 171px;
   width: 35px;
   height: 150px;
   cursor: n-resize;
}
.colorpicker_hue div {
   position: absolute;
   width: 35px;
   height: 9px;
   overflow: hidden;
   background: url(https://i.servimg.com/u/f83/17/45/19/77/colorp11.gif) left top;
   margin: -4px 0 0 0;
   left: 0px;
}
.colorpicker_new_color {
   position: absolute;
   width: 60px;
   height: 30px;
   left: 213px;
   top: 13px;
   background: #f00;
}
.colorpicker_current_color {
   position: absolute;
   width: 60px;
   height: 30px;
   left: 283px;
   top: 13px;
   background: #f00;
}
.colorpicker input {
   background-color: transparent;
   border: 1px solid transparent;
   position: absolute;
   font-size: 10px;
   font-family: Arial, Helvetica, sans-serif;
   color: #898989;
   top: 4px;
   right: 11px;
   text-align: right;
   margin: 0;
   padding: 0 !important;
   height: 11px;
}
.colorpicker_hex {
   position: absolute;
   width: 72px;
   height: 22px;
   background: url(https://i.servimg.com/u/f83/17/45/19/77/custom11.png) top;
   left: 212px;
   top: 142px;
}
.colorpicker.dark .colorpicker_hex {
   background: url(https://i.servimg.com/u/f83/17/45/19/77/colorp11.png) top;
}
.colorpicker_hex input {
   right: 6px;
}
.colorpicker_field {
   height: 22px;
   width: 62px;
   background-position: top;
   position: absolute;
}
.colorpicker_field span {
   position: absolute;
   width: 12px;
   height: 22px;
   overflow: hidden;
   top: 0;
   right: 0;
   cursor: n-resize;
}
.colorpicker_rgb_r {
   background-image: url(https://i.servimg.com/u/f83/17/45/19/77/custom12.png);
   top: 52px;
   left: 212px;
}
.colorpicker.dark .colorpicker_rgb_r{
 background-image: url(https://i.servimg.com/u/f83/17/45/19/77/colorp12.png);
}
.colorpicker_rgb_g {
   background-image: url(https://i.servimg.com/u/f83/17/45/19/77/custom13.png);
   top: 82px;
   left: 212px;
}
.colorpicker.dark .colorpicker_rgb_g {
 background-image: url(https://i.servimg.com/u/f83/17/45/19/77/colorp13.png);
}
.colorpicker_rgb_b {
   background-image: url(https://i.servimg.com/u/f83/17/45/19/77/custom14.png);
   top: 112px;
   left: 212px;
}
.colorpicker.dark .colorpicker_rgb_b {
 background-image: url(https://i.servimg.com/u/f83/17/45/19/77/colorp14.png);
}
.colorpicker_hsb_h, .colorpicker_hsb_s, .colorpicker_hsb_b {
 display: none;
}
.colorpicker_submit {
 position: absolute;
    background: url(\\\\\\\"https://i.servimg.com/u/f83/17/45/19/77/accept10.png\\\\\\\") no-repeat;
    cursor: pointer;
    right: 10px;
 width: 48px;
 height: 50px;
    top: 118px;  
 overflow: hidden;
}
.colorpicker_focus {
   background-position: center;
}
.colorpicker_hex.colorpicker_focus {
   background-position: bottom;
}
.colorpicker_submit.colorpicker_focus {
   background-position: bottom;
}
.colorpicker_slider {
   background-position: bottom;
}
.colorpicker { z-index: 3; }
